# Admin Priveleges required
function main {
    
    $url = "ftp://ftp.adobe.com/pub/adobe/reader/win/AcrobatDC/"

    #region create temp location to download exe installer
    $ParentDir = "$PsScriptRoot\output"
    $tmpDir = "$ParentDir\Tmp"
    if (Test-Path $ParentDir) {}
    else { $null = New-Item $ParentDir -ItemType Directory }
    if (Test-Path $tmpDir ) {}
    else { $null = New-Item $tmpDir -ItemType Directory }
    #endregion create temp location to download exe installer

    #region get the latest installer version on ftp server
    $FTPRequest = [System.Net.FtpWebRequest]::Create("$url") 
    $FTPRequest.Method = [System.Net.WebRequestMethods+Ftp]::ListDirectory
    $FTPResponse = $FTPRequest.GetResponse()
    $ResponseStream = $FTPResponse.GetResponseStream()
    $FTPReader = New-Object System.IO.Streamreader -ArgumentList $ResponseStream
    $DirList = $FTPReader.ReadToEnd()
    #from Directory Listing get last entry in list, but skip one to avoid the 'misc' dir
    $LatestUpdate = $DirList -split "`r`n" | Where-Object { $_ } | Select-Object -Last 1 -Skip 1
    #endregion get the latest installer version

    #region download sources
    $FileName = "AcroRdrDC${LatestUpdate}_en_US.exe"
    $url = "${url}${LatestUpdate}/${FileName}"
    
    (New-Object System.Net.WebClient).DownloadFile($url, "$tmpDir\$FileName")
    $NewSource = Get-Item "$tmpDir\$FileName"
    #endregion download sources

    #region extract msi, create msp files
    #Extract msi data from exe
    $exitCode = (Start-Process -FilePath $NewSource.FullName -ArgumentList "-sfx_o`"$ParentDir`" -sfx_ne  -sfx_nu" -Wait -NoNewWindow -PassThru).ExitCode
    if ($exitCode -eq 0) { Remove-Item $tmpDir -Force -Confirm:$false -Recurse } 
    else { throw "Extract msi failed" }
    # Get binary data from mst and save it as string, do not uncomment. It is for explanation only 
    # $CegalMSTBinary = [Convert]::ToBase64String([io.file]::ReadAllBytes("$ParentDir\Cegal.mst"))
    # Create Cegal.mst
    [io.file]::WriteAllBytes("$ParentDir\Cegal.mst", [System.Convert]::FromBase64String($CegalMSTBinary))
    # Create Cegal2.mst
    [io.file]::WriteAllBytes("$ParentDir\Cegal2.mst", [System.Convert]::FromBase64String($Cegal2MSTBinary))
    #endregion extract msi, create msp files

    #region get product information
    $msiFile = Get-Item "$ParentDir\AcroRead.msi"
    $mspFile = Get-Item "$ParentDir\AcroRdrDCUpd*.msp"

    $ProductName = (get-msiproperty -FilePath $msiFile.FullName).ProductName
    $mspInfo = [xml](New-Object -ComObject WindowsInstaller.Installer ).ExtractPatchXMLData($mspFile.FullName)
    $ProductVersion = $mspInfo.MsiPatch.TargetProduct[0].UpdatedVersion
    #endregion get product information
    

    #region create install.ps1 script
    $ScriptTemplate = $ScriptTemplate -replace "<AppName>", $ProductName
    $ScriptTemplate = $ScriptTemplate -replace "<AppVersion>", $ProductVersion
    $ScriptTemplate = $ScriptTemplate -replace "<MsiName>", $msiFile.Name
    $ScriptTemplate = $ScriptTemplate -replace "<MspName>", $mspFile.Name

    $ScriptTemplate | Out-File -FilePath "$PSscriptRoot\output\install.ps1"
    #endregion create install.ps1 script
} 

function get-msiproperty {
    param ( [Parameter(Mandatory)] [String] $FilePath )

    # open msi in read only mode
    $READONLY = 0
    $msidb = (New-Object -ComObject WindowsInstaller.Installer ).OpenDatabase("$FilePath", $READONLY)

    # read property table
    $queryString = 'SELECT * FROM `Property`'
    $PropertyTable = $msidb.OpenView($queryString)
    $PropertyTable.Execute()

    # read each property name and value row-by-row
    $PROP_NAME_ID = 1
    $PROP_VALUE_ID = 2
    $Props = @{ }
    do {
        $Property = $PropertyTable.Fetch()
        If ($null -eq $Property) { break }
        $PropName = $Property.StringData($PROP_NAME_ID)
        $PropVal = $Property.StringData($PROP_VALUE_ID)
        $Props[$PropName] = $PropVal
    } while ($true)

    $PropertyTable.Close
    $msidb.Close

    # return result as ps object
    New-Object -TypeName PSObject -Property $Props
}

$ScriptTemplate = @'
<#PSScriptInfo
.VERSION
    2.1
.NOTE
    N/A
.PREREQUISITES
    N/A
.EXTERNAL CONFIGURATION ITEMS
    N/A
#>

# Provide Package Name to be used in logging and output
$PkgName = 'Adobe-Acrobat-Reader-DC-<AppVersion>'

function Start-ProductInstall {
    [CmdletBinding()]
    param()
#region // PUT REQUIRED CODE FOR INSTALLATION BELOW THIS LINE // ****************************************************
    #Define variables
    $MSIFileName = "<MsiName>"
    $MSPFileName = "<MspName>"

    #Taskkill Reader if already running
    $ProcessName = "AcroRd32.exe"
    if (Get-Process -Name $ProcessName -ErrorAction SilentlyContinue) { Stop-Process -Name $ProcessName -Force -ErrorAction SilentlyContinue | Out-Null; $? }
    else { $true }

    $ProductName = "<AppName>"
    $ProductVersion = "<AppVersion>"
    if (-not (Get-InstalledSoftware -DisplayName "$ProductName" -DisplayVersion "$ProductVersion")) {
        #Start main install
        Start-WindowsInstaller -MSIFile "$PSScriptRoot\$MSIFileName" -InstallParams "TRANSFORMS=$PSScriptRoot\Cegal.mst;$PSScriptRoot\Cegal2.mst ADDLOCAL=ALL ALLUSERS=1 REBOOT=ReallySuppress /qn /L*v `"$env:Windir\Logs\$($PkgName)_appinstaller.log`""
        #Start patch install
        Start-WindowsInstallerPatch -FilePath "$PSScriptRoot\$MSPFileName" -Params "ALLUSERS=1 REBOOT=ReallySuppress /qn /L*v `"$($env:Windir)\Logs\$($PkgName)_patchinstaller.log`""
    } else { Write-InstallLog "UserOutput: $PkgName is already installed" }
    
    #Create HideMenu.js to disable Repair menu
    #app.hideMenuItem("DetectAndRepair");
    #app.hideMenuItem("SystemInformation");
    $fileName = "%ProgramFiles(x86)%\Adobe\Acrobat Reader DC\Reader\Javascripts\HideMenu.js"
    $content1 = "app.hideMenuItem(`"DetectAndRepair`");"
    $content2 = "app.hideMenuItem(`"SystemInformation`");"
    Add-LineToFile -fileName $fileName -content $content1
    if ($errVar) {Write-InstallLog "UserOutput: $PkgName failed to add text $content1 in $fileName" -isError}
    else {Write-InstallLog "UserOutput: $PkgName text $content1 added in $fileName"}  
    Add-LineToFile -fileName $fileName -content $content2
    if ($errVar) {Write-InstallLog "UserOutput: $PkgName failed to add text $content2 in $fileName" -isError}
    else {Write-InstallLog "UserOutput: $PkgName text $content2 added in $fileName"}  

    # Disable "Adobe Acrobat Update Service"
    $ServiceName = "AdobeARMservice" #EXAMPLE: $ServiceName = "AppMgmt". Put Service Name (not Display Name).
    $ServiceExists = Get-Service -Name $ServiceName -ErrorAction SilentlyContinue
    if ($ServiceExists) {
        Stop-Service -Name $ServiceName -Force -ErrorAction SilentlyContinue
        Set-Service -Name $ServiceName -StartupType Disabled -ErrorAction SilentlyContinue
        $ServiceAfter = Get-Service -Name $ServiceName -ErrorAction SilentlyContinue
	    Write-InstallLog "UserOutput: Service `"$ServiceName`" is $($ServiceAfter.Status)."
    } else { Write-InstallLog "UserOutput: Service `"$ServiceName`" was not found" }

} #endregion // END OF REQUIRED CODE // *****************************************************************************
#region // PUT ANY REQUIRED ADDITIONAL FUNCTIONS BELOW THIS LINE // *************************************************

function Start-WindowsInstaller {
    [CmdletBinding()]
    param(
        [Parameter(Mandatory=$True)] [string]$MSIFile,
        [string]$InstallParams = ""
    )
    $commandLine = "/i `"$MSIFile`" $InstallParams"
    Write-InstallLog "UserOutput: Starting: msiexec $commandLine"
    $exitCode = (Start-Process -FilePath 'msiexec.exe' -ArgumentList $commandLine -Wait -PassThru).ExitCode
    if ((0,3010) -notcontains $exitCode ) { Write-InstallLog "Installation failed with exit code: $exitCode" -isError }
    else { Write-InstallLog "UserOutput: Installation finished with exit code: $exitCode" }
}

function Start-WindowsInstallerPatch {
    [CmdletBinding()] param (
	[Parameter(Mandatory=$True)] [String]$FilePath,
	[String]$Params
    )
	$successExitCodes = @(3010,0)
    $CommandLine = "/p `"$FilePath`" $Params"
    Write-InstallLog "UserOutput: Starting: msiexec.exe $CommandLine"
    $exitCode = (Start-Process -FilePath 'msiexec.exe' -ArgumentList $CommandLine -PassThru -Wait).ExitCode
    if ($successExitCodes -notcontains $exitCode) { Write-InstallLog "Installation failed with exit code: $exitCode" -isError }
    else { Write-InstallLog "UserOutput: Installation finished with exit code: $exitCode" }
}

function Get-InstalledSoftware {
    param(
        [string]$DisplayName,
        [string]$DisplayVersion,
        [string]$arch = "any")

    $(switch -regex ($arch) {
            ".*64.*|any" { "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Uninstall\*" }
            "^((?!64).)*$" { "HKLM:\SOFTWARE\WOw6432Node\Microsoft\Windows\CurrentVersion\Uninstall\*" }
        } ) | Get-ItemProperty | Select-Object DisplayName, DisplayVersion |
    Where-Object { ($_.DisplayName -like "$DisplayName") -and ($_.DisplayVersion -like "$DisplayVersion") }
}

function Add-LineToFile {
    param([string]$fileName, [string]$content)
    $fileName = [System.Environment]::ExpandEnvironmentVariables($fileName)
    if (Test-Path $fileName) {
        $content -split "`r`n" |
        ForEach-Object {
            $str = $_
            $exist = $false
            (Get-Content $fileName) | 
            Foreach-Object { if ($_ -eq $str) { $exist = $true } }
            if (!$exist) { Add-Content -Path $fileName -Value $str | Out-Null }
        }
    } else {
        $split_dir = Split-Path -Path $fileName
        $split_file = Split-Path -Path $fileName -Leaf
        if (!(Test-Path $split_dir)) { New-Item $split_dir -ItemType Directory -Force | Out-Null }
        $content = $content + "`r`n"
        New-item -path $split_dir -name $split_file -type "file" -value $content | Out-Null
    }
}

#endregion // END OF ADDITIONAL FUNCTIONS // ************************************************************************
#region // DO NOT EDIT TEXT BELOW // ********************************************************************************
# Logging function
function Write-InstallLog {
    [CmdletBinding()]
    param(
        [Parameter(Mandatory=$True, ValueFromPipeline=$True)] $Message,
        [switch]$isError
    )
    if ($isError) {
        $Message = $Message.ToUpper()
        "$(Get-Date) ERROR: $Message".Replace("UserOutput:", '') | Out-File $LogFile -Append
        throw $Message}
    else {
        "$(Get-Date): $Message".Replace("UserOutput:", '') | Out-File $LogFile -Append
        Write-Output $Message }
}

$LogFile = "$env:WinDir\Logs\${PkgName}_Script.txt"

@"
$('='*32) $(Get-Date) $('='*32) 
START INSTALLATION FOR ${PkgName}:
"@ | Out-File $LogFile -Append

# Launching main block
try {
    Start-ProductInstall
    Write-Output "UserOutput:$PkgName setup completed! See $env:WinDir\Logs\${PkgName}_Script.txt for details." }
catch{
    $msg = "FOUND ERRORS:`n${_}`n"
    Write-Error "$PkgName - Installation Failed!`n$msg See $env:WinDir\Logs\${PkgName}_Script.txt for details." }
#endregion // NO EDITS // ********************************************************************************************
'@

$CegalMSTBinary = ''

$Cegal2MSTBinary = ''

main